import {AppBar,Toolbar, Typography} from '@material-ui/core';
const Home=()=>{
    return(
        <AppBar>
            <Toolbar>
                <Typography>HOME</Typography>
                <Typography>ABOUT</Typography>
                <Typography>CONTACT</Typography>
                <Typography>LOGIN</Typography>
            </Toolbar>
        </AppBar>
    )
}

export default Home;
